import React, {useState} from 'react';
import './App.css';

function Card (num, suit){
  this.num = num;
  this.suit = suit;
}

const generateDeck = () => {
  const newDeck = new Set();
  const suits = ["♦", "♥", "♣", "♠"];
  for(const suit of suits){
    for(let i = 1; i <= 13; i++){
      newDeck.add(new Card(i, suit));
    }
  }
  return newDeck;
}

const handleClick = (e)=>{
  e.preventDefault();
}

function App() {

  const [deck, setDeck] = useState(setDeck);
  setDeck = generateDeck()
  console.log(deck);

  return (
    <div className="App">
      <h1>Deck of Cards</h1>
      <input type="text"/>
      <button onClick={handleClick}>Submit</button>
    </div>
  );
}

export default App;
